/*Table structure for table `stu_course` */

DROP TABLE IF EXISTS `stu_course`;

CREATE TABLE `stu_course` (
  `course_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '课程编号',
  `course_name` varchar(60) NOT NULL COMMENT '课程名',
  `course_credit` int(3) NOT NULL COMMENT '学分',
  `course_hours` int(3) NOT NULL COMMENT '学时',
  `tea_id` bigint(20) NOT NULL COMMENT '任课教师',
  `course_date` date NOT NULL COMMENT '开课时间',
  `studying_way` char(1) NOT NULL DEFAULT '0' COMMENT '修读方式（0 必修 1 限选   2 任选  ）',
  `course_type` enum('公共必修课','公共选修课','集中实践课','拓展课程','专业基础课','专业核心课','专业选修课') NOT NULL COMMENT '课程大类',
  `scaled_grades_proportion` float(11,2) NOT NULL DEFAULT '0.60' COMMENT '卷面成绩占比',
  `usual_grades_proportion` float(11,2) NOT NULL DEFAULT '0.40' COMMENT '平时成绩占比',
  `class_id` bigint(20) NOT NULL COMMENT '班级编号',
  `term` varchar(120) NOT NULL COMMENT '学期',
  PRIMARY KEY (`course_id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 COMMENT='课程表';

