/*Table structure for table `stu_grade` */

DROP TABLE IF EXISTS `stu_grade`;

CREATE TABLE `stu_grade` (
  `grade_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '课程明细编号',
  `stu_id` bigint(20) NOT NULL COMMENT '学生编号',
  `course_id` bigint(20) NOT NULL COMMENT '课程编号',
  `grade_gpa` double(11,2) DEFAULT NULL COMMENT '课程绩点',
  `scaled_grades` double(11,2) DEFAULT NULL COMMENT '卷面成绩',
  `usual_grades` double(11,2) DEFAULT NULL COMMENT '平时成绩',
  `score_grades` double(11,2) DEFAULT NULL COMMENT '最终成绩',
  `exam_id` bigint(20) DEFAULT NULL COMMENT '考试编号',
  `grade_entry_time` datetime DEFAULT NULL COMMENT '成绩录入时间',
