  KEY `FK_scoreid` (`course_id`),
  KEY `FK_stuid` (`stu_id`),
  CONSTRAINT `FK_scoreid` FOREIGN KEY (`course_id`) REFERENCES `stu_course` (`course_id`),
  CONSTRAINT `FK_stuid` FOREIGN KEY (`stu_id`) REFERENCES `stu_student` (`stu_id`)
) ENGINE=InnoDB AUTO_INCREMENT=64 DEFAULT CHARSET=utf8 COMMENT='课程明细信息表';

