/*Data for the table `stu_teacher` */

insert  into `stu_teacher`(`tea_id`,`tea_num`,`tea_name`,`tea_sex`,`tea_age`,`tea_description`,`job_title`,`department_id`,`del_flag`) values (1,'10000','罗建平','2','1940-07-18','罗建平，计算机高级工程师。本科、研究生、硕士、博研分别就读于成都科技大学（并入四川大学）、西北工业大学、法国格勒诺布尔大学、法国国家计算机研究所的计算机相关专业；取得美国电报电话公司（AT&T）网络综合布线工程师培训结业证书。曾担任长城计算机集团下属深圳企业视像技术部副经理、香港移动深圳研发中心高级研究员、深圳商业银行（现为平安银行）网络安全主管，及多家软件应用开发企业高级工程师、主管、职位；曾担任上市公司网络产品定型鉴定专家组成员和大型项目评标组委成员；现担任广东技术师范大学天河学院计算机科学与工程学院教师；兼具企业工作与高校教学经验，可使用英语和法语进行技术交流与教学。曾在行业多个刊物上发表技术文章。工作期间多次前往美、日、加等国家进行访问、调研，保持行业前沿技术跟踪。','计算机高级工程师',1,'0'),(2,'10001','刘飞生','0','1990-04-18','刘飞生，男，1990年4月，双硕士学位，计算机高级工程师，高级信息系统项目管理师。具有多年企业工作经历及高校教学经验，现任职广州理工学院计算机科学与工程学院专任教师。主要承担《C语言程序设计》、《数据结构》、《离散数学》、《云计算》、《信息系统分析与设计》、《面向对象程序语言》、《高等数学》等课程的教学工作。曾获南昌职业大学优秀教师，指导学生参加江西省信息技术知识竞赛获三等奖，指导学生参加全国新能源汽车虚拟大赛获得一等奖、二等奖。','计算机高级工程师，高级信息系统项目管理师',1,'0'),(3,'10002','陈焰','1','1944-06-22','陈焰，讲师，硕士研究生，高级信息系统项目管理师，毕业于华中师范大学信息技术系，现任计算机科学与工程学院专任老师。主要担任的课程有《C语言程序设计》、《web前端应用开发》、《PHP动态网站开发》等。先后在国内相关中文学术期刊杂志发表论文有《基于微信公众号的学习平台研究》、《基于任务驱动的合作学习模式研究》等十余篇，参编教材2本，主持并参与的课题有《基于网络平台开展智慧课堂互动教学的设计与创新研究》、省级精品资源共享课程《Flash动画制作》等。\n\n','讲师',1,'0'),(4,'10003','陈智勇','0','1980-02-29','陈智勇，1981年出生，男，37岁，计算机科学与技术专业讲师,广东工业大学硕士学位。2005年至今，任教于计算机科学与工程学院；主要担任《数据仓库与数据挖掘》，《大数据技术基础》，《人工智能》《算法与数据结构》、《程序设计基础》，《移动应用开发》《计算机组装与维护》等课程教学工作。主要研究方向，大数据及挖掘技术，移动应用开发，嵌入式开发，多次指导学生获得省级大学生创新创业项目，多次获得教学评比优秀、良好荣益。多次指导IT数码工作室教研创新团队。\n\n','讲师',1,'0'),(5,'10004','周少波','0','2022-11-22','周少波，男，1977年出生，软件设计师、计算机软件讲师。从事计算机教学工作多年，主要担任《操作系统原理与应用》、《软件测试技术》、《信息系统分析与设计》等课程教学工作。主要研究方向是信息系统开发。2010届、2011届优秀毕业设计指导教师。2014年指导学生参加泛珠三角大学生计算机作品赛、广东省大学生毕业设计作品大赛荣获三等奖， 2016年指导学生参加第七届“蓝桥杯”全国软件和信息技术专业人才大赛(Java B)广东赛区一等奖、国家三等奖；2018年指导学生参加第九届“蓝桥杯”全国软件和信息技术专业人才大赛(Java B)广东赛区一等奖、国家三等奖；','讲师',1,'0'),(6,'10005','蔡岳良','0','2000-06-22','蔡岳良，党总支副书记兼学生管理工作副院长，男，中共党员，讲师，研究生毕业于华中科技大学软件工程专业。先后担任电气与电子工程学院辅导员兼任党总支组织委员、团总支书记、学生党支部书记，外国语学院办公室主任兼任党总支宣传委员、教工党支部书记等职务。任职期间撰写《论辅导员与校园突发性事务》、《大学生党员教育与管理》、《如何提高岗位的任职能力》等多篇论文；申报“创新党建育人平台及工作模式”项目，参与省级“十二五”规划研究项目（德育专项）课题《独立学院辅导员在突发事件中的危机管理研究》；积极搭建各种协同育人平台，创新人才培养模式，指导学生社团参加校内外比赛均取得优异成绩；2017年所在党支部被评为教育工委“三型党支部”；多次带领师生党员参加各项社会实践活动，多家媒体跟踪报道，获得学校及教育工委的好评，其中2018年海洋环保活动获得省教育工委重点项目立项。多次荣获“优秀辅导员”、“优秀员工”、“就业先进个人”、“优秀党务工作者”等荣誉称号。\n\n','党总支副书记兼学生管理工作副院长',1,'0'),(7,'10006','赵玉刚','0','2022-04-30','赵玉刚，男，毕业于吉林大学计算机学院，硕士研究生，讲师。主要讲授《数据结构与算法》、《C语言程序设计》等课程。主要研究方向：企业级软件开发及嵌入式技术。参与《吉林省移动公司综合网络管理系统》等多个企业软件、嵌入式系统研发项目，公开发表《无线传感器网络拓扑控制》等多篇核心期刊论文。\n\n','讲师',1,'0'),(8,'20131','test','2','2022-11-17','213','21312',4,'0');

/*Table structure for table `sys_config` */

DROP TABLE IF EXISTS `sys_config`;

CREATE TABLE `sys_config` (
  `config_id` int(5) NOT NULL AUTO_INCREMENT COMMENT '参数主键',
  `config_name` varchar(100) DEFAULT '' COMMENT '参数名称',
  `config_key` varchar(100) DEFAULT '' COMMENT '参数键名',
  `config_value` varchar(500) DEFAULT '' COMMENT '参数键值',
  `config_type` char(1) DEFAULT 'N' COMMENT '系统内置（Y是 N否）',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`config_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='参数配置表';

/*Data for the table `sys_config` */

insert  into `sys_config`(`config_id`,`config_name`,`config_key`,`config_value`,`config_type`,`create_by`,`create_time`,`update_by`,`update_time`,`remark`) values (1,'主框架页-默认皮肤样式名称','sys.index.skinName','skin-blue','Y','admin','2022-11-15 17:25:45','',NULL,'蓝色 skin-blue、绿色 skin-green、紫色 skin-purple、红色 skin-red、黄色 skin-yellow'),(2,'用户管理-账号初始密码','sys.user.initPassword','123456','Y','admin','2022-11-15 17:25:45','',NULL,'初始化密码 123456'),(3,'主框架页-侧边栏主题','sys.index.sideTheme','theme-dark','Y','admin','2022-11-15 17:25:45','',NULL,'深色主题theme-dark，浅色主题theme-light'),(4,'账号自助-验证码开关','sys.account.captchaEnabled','true','Y','admin','2022-11-15 17:25:45','',NULL,'是否开启验证码功能（true开启，false关闭）'),(5,'账号自助-是否开启用户注册功能','sys.account.registerUser','false','Y','admin','2022-11-15 17:25:45','',NULL,'是否开启注册用户功能（true开启，false关闭）');

/*Table structure for table `sys_dept` */

DROP TABLE IF EXISTS `sys_dept`;

CREATE TABLE `sys_dept` (
  `dept_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '部门id',
  `parent_id` bigint(20) DEFAULT '0' COMMENT '父部门id',
  `ancestors` varchar(50) DEFAULT '' COMMENT '祖级列表',
  `dept_name` varchar(30) DEFAULT '' COMMENT '部门名称',
  `order_num` int(4) DEFAULT '0' COMMENT '显示顺序',
  `leader` varchar(20) DEFAULT NULL COMMENT '负责人',
  `phone` varchar(11) DEFAULT NULL COMMENT '联系电话',
  `email` varchar(50) DEFAULT NULL COMMENT '邮箱',
  `status` char(1) DEFAULT '0' COMMENT '部门状态（0正常 1停用）',
  `del_flag` char(1) DEFAULT '0' COMMENT '删除标志（0代表存在 2代表删除）',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`dept_id`)
